export default schema;
declare const schema: "\n  scalar JSON\n  scalar JSONObject\n\n  interface EntityMetadata {\n    name: String!\n    annotations: JSONObject!\n    annotation(name: String!): JSON\n    labels: JSONObject!\n    label(name: String!): JSON\n    uid: String!\n    etag: String!\n  }\n\n  type DefaultEntityMetadata implements EntityMetadata {\n    name: String!\n    annotations: JSONObject!\n    annotation(name: String!): JSON\n    labels: JSONObject!\n    label(name: String!): JSON\n    uid: String!\n    etag: String!\n  }\n\n  type ComponentMetadata implements EntityMetadata {\n    name: String!\n    annotations: JSONObject!\n    annotation(name: String!): JSON\n    labels: JSONObject!\n    label(name: String!): JSON\n    uid: String!\n    etag: String!\n    # mock field to prove extensions working\n    relationships: String\n  }\n\n  type TemplateMetadata implements EntityMetadata {\n    name: String!\n    annotations: JSONObject!\n    annotation(name: String!): JSON\n    labels: JSONObject!\n    label(name: String!): JSON\n    uid: String!\n    etag: String!\n    # mock field to prove extensions working\n    updatedBy: String\n  }\n\n  # TODO: move this definition into plugin-scaffolder-graphql\n  type TemplateEntitySpec {\n    type: String!\n    path: String\n    schema: JSONObject!\n    templater: String!\n  }\n\n  type ComponentEntitySpec {\n    type: String!\n    lifecycle: String!\n    owner: String!\n  }\n\n  type DefaultEntitySpec {\n    raw: JSONObject\n  }\n\n  union EntitySpec =\n      DefaultEntitySpec\n    | TemplateEntitySpec\n    | ComponentEntitySpec\n\n  type CatalogEntity {\n    apiVersion: String!\n    kind: String!\n    metadata: EntityMetadata\n    spec: EntitySpec!\n  }\n\n  type CatalogQuery {\n    list: [CatalogEntity!]!\n  }\n\n  type Query {\n    catalog: CatalogQuery!\n  }\n";
